import React from 'react'
import { Link } from 'react-scroll';
import './navbar.css';

const Navbar = () => {
  return (
    <nav className='navbar'>
        <Link className='navBarItem'>Home</Link>
        <Link className='navBarItem'>About Me</Link>
        <Link className='navBarItem'>Experience</Link>
        <Link className='navBarItem'>Contact Me</Link>
    </nav>
  )
}

export default Navbar
